import './App.css';
import './header/Header.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>React js</h2>
        <div className="header">
           <h1>App Header</h1>

        </div>
      </header>
    </div>
  );

  const shoot = () => {
    alert("Great Shot!");
  }

  return (
    <button onClick={shoot}>Take the shot!</button>
  );
}


export default App;
